import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
  FaTrash,
  FaFilePdf,
  FaUniversity,
  FaLayerGroup,
  FaBook,
} from 'react-icons/fa';

const API = axios.create({
  baseURL: process.env.REACT_APP_API_BASE,
});

const ManageNotes = () => {
  const [notes, setNotes] = useState([]);

  // Fetch all notes
  useEffect(() => {
    const fetchNotes = async () => {
      try {
        const res = await API.get('/api/resources/notes');
        setNotes(res.data);
      } catch (err) {
        console.error('Failed to fetch notes:', err);
      }
    };

    fetchNotes();
  }, []);

  // Delete a note
  const handleDelete = async (id) => {
    if (window.confirm('Are you sure you want to delete this note?')) {
      try {
        await API.delete(`/api/resources/${id}`);
        setNotes(notes.filter((note) => note._id !== id));
      } catch (err) {
        console.error('Failed to delete note:', err);
      }
    }
  };

  return (
    <div className="p-4">
      <h2 className="text-xl font-semibold mb-4 flex items-center gap-2">
        <FaFilePdf /> Manage Notes
      </h2>

      {notes.length === 0 ? (
        <p>No notes found.</p>
      ) : (
        <div className="overflow-x-auto">
          <table className="min-w-full table-auto border">
            <thead className="bg-gray-100">
              <tr>
                <th className="px-4 py-2 text-left">Title</th>
                <th className="px-4 py-2 text-left">University</th>
                <th className="px-4 py-2 text-left">Department</th>
                <th className="px-4 py-2 text-left">Course</th>
                <th className="px-4 py-2 text-left">Semester</th>
                <th className="px-4 py-2 text-left">File</th>
                <th className="px-4 py-2 text-left">Actions</th>
              </tr>
            </thead>
            <tbody>
              {notes.map((note) => (
                <tr key={note._id} className="border-b hover:bg-gray-50">
                  <td className="px-4 py-2">{note.title}</td>
                  <td className="px-4 py-2 flex items-center gap-1">
                    <FaUniversity /> {note.universityName}
                  </td>
                  <td className="px-4 py-2 flex items-center gap-1">
                    <FaLayerGroup /> {note.department}
                  </td>
                  <td className="px-4 py-2 flex items-center gap-1">
                    <FaBook /> {note.course}
                  </td>
                  <td className="px-4 py-2">{note.semester}</td>
                  <td className="px-4 py-2">
                    <a
                      href={note.fileUrl}
                      target="_blank"
                      rel="noopener noreferrer"
                      className="text-blue-600 hover:underline"
                    >
                      View File
                    </a>
                  </td>
                  <td className="px-4 py-2">
                    <button
                      className="text-red-600 hover:text-red-800"
                      onClick={() => handleDelete(note._id)}
                    >
                      <FaTrash />
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default ManageNotes;
